    <script>
        var audioEnabled = null;

        /* function openURL() {
            dapi.openStoreUrl(
                "https://apps.apple.com/us/app/splashlearn-kids-learning-app/id672658828"
            );
        } */

        window.onload = function() {

            var soundEnabled = true;


            window.audioEnabled = true;
            /* (dapi.isReady()) ? onReadyCallback(): dapi.addEventListener("ready", onReadyCallback); */

            /* let isAudioEnabled = !!mraid.getAudioVolume(); */

            if (mraid.getState() === 'loading') {
                mraid.addEventListener('ready', onSdkReady);
            } else {
                onSdkReady();
            }
            /* window.audioEnabled = isAudioEnabled;
            if (isAudioEnabled) {
                document.getElementById("bgMusic").play();
                document.getElementById("bgMusic").volume = 1;
                document.getElementById("tapMusic").volume = 1;
                document.getElementById("victoryMusic").volume = 1;
                document.getElementById("tryagainMusic").volume = 1;

            } else {
                document.getElementById("bgMusic").pause();
                document.getElementById("tapMusic").pause();
                document.getElementById("victoryMusic").pause();
                document.getElementById("tryagainMusic").pause();
                document.getElementById("bgMusic").volume = 0;
                document.getElementById("tapMusic").volume = 0;
                document.getElementById("victoryMusic").volume = 0;
                document.getElementById("tryagainMusic").volume = 0;
            } */

            function viewableChangeHandler(viewable) {
                // start/pause/resume gameplay, stop/play sounds
                if (viewable) {

                    document.getElementById("bgMusic").play();
                    document.getElementById("bgMusic").volume = 1;
                } else {
                    document.getElementById("bgMusic").pause();
                    document.getElementById("tapMusic").pause();
                    document.getElementById("victoryMusic").pause();
                    document.getElementById("tryagainMusic").pause();
                    document.getElementById("bgMusic").volume = 0;
                    document.getElementById("tapMusic").volume = 0;
                    document.getElementById("victoryMusic").volume = 0;
                    document.getElementById("tryagainMusic").volume = 0;
                }
            }

            function onSdkReady() {
                mraid.addEventListener('viewableChange',
                    viewableChangeHandler);

                /* mraid.addEventListener("audioVolumeChange", (function(n) {
                    soundEnabled = !1, n && n >= 10 && (soundEnabled = !0), console.log(soundEnabled)
                })) */

                mraid.addEventListener('audioVolumeChange',
                    handleVolumeChange);
                // Wait for the ad to become viewable for the first time
                if (mraid.isViewable()) {
                    showMyAd();
                }
            }

            function handleVolumeChange(volumePercentage) {
                if (volumePercentage && volumePercentage >= 10.0) {
                    window.audioEnabled = true;
                    document.getElementById("bgMusic").play();
                    document.getElementById("bgMusic").volume = 1;
                    document.getElementById("tapMusic").volume = 1;
                    document.getElementById("victoryMusic").volume = 1;
                    document.getElementById("tryagainMusic").volume = 1;
                } else {
                    window.audioEnabled = false;
                    document.getElementById("bgMusic").pause();
                    document.getElementById("tapMusic").pause();
                    document.getElementById("victoryMusic").pause();
                    document.getElementById("tryagainMusic").pause();
                    document.getElementById("bgMusic").volume = 0;
                    document.getElementById("tapMusic").volume = 0;
                    document.getElementById("victoryMusic").volume = 0;
                    document.getElementById("tryagainMusic").volume = 0;
                }

            }

            function showMyAd() {

            }

            window.addEventListener("blur", pause);
            window.addEventListener("focus", play);

        };

        function openURL() {
            // Detect platform from user agent
            var userAgent = navigator.userAgent || navigator.vendor;
            var url = "https://apps.apple.com/us/app/splashlearn-kids-learning-app/id672658828";
            var android = "https://play.google.com/store/apps/details?id=com.splash.kids.education.learning.games.free.multiplication.reading.math.grade.app.splashmath";
            if (/android/i.test(userAgent)) {
                url = android;
            }
            mraid.open(url);

        }

        function pause() {
            document.getElementById("bgMusic").pause();
            document.getElementById("tapMusic").pause();
            document.getElementById("victoryMusic").pause();
            document.getElementById("tryagainMusic").pause();
            document.getElementById("bgMusic").volume = 0;
            document.getElementById("tapMusic").volume = 0;
            document.getElementById("victoryMusic").volume = 0;
            document.getElementById("tryagainMusic").volume = 0;
        }

        function play() {
            document.getElementById("bgMusic").play();
            document.getElementById("bgMusic").volume = 1;
            document.getElementById("tapMusic").volume = 1;
            document.getElementById("victoryMusic").volume = 1;
            document.getElementById("tryagainMusic").volume = 1;
        }
    </script>
